import React from "react";
// import { Grid, Container } from "@material-ui/core";

function Subscribe() {
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>Subscribe for News and Updates</h1>
      <form style={{ textAlign: "center" }}>
        <input
          style={{ width: "25%", padding: "7px" }}
          type="text"
          name="name"
        />
        <input
          style={{
            padding: "11px 25px",
            backgroundColor: "#f0800e",
            border: "none",
            color: "white",
            borderRadius: "2px",
            marginLeft: "5px"
          }}
          type="submit"
          value="Subscribe"
        />
      </form>
    </div>
  );
}

export default Subscribe;
